PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" text NOT NULL);
CREATE TABLE "wows" ("id" SERIAL PRIMARY KEY NOT NULL, "game" text, "racename" text, "pagename" text, "title" text, "desc" text, "customcode" text, "created_at" timestamp, "updated_at" timestamp, "slug" text);
CREATE TABLE "gw2s" ("id" SERIAL PRIMARY KEY NOT NULL, "game" text, "racename" text, "pagename" text, "title" text, "desc" text, "customcode" text, "created_at" timestamp, "updated_at" timestamp, "slug" text);
CREATE TABLE "samps" ("id" SERIAL PRIMARY KEY NOT NULL, "game" text, "racename" text, "pagename" text, "title" text, "desc" text, "customcode" text, "created_at" timestamp, "updated_at" timestamp, "slug" text);
CREATE TABLE "syllables" ("id" SERIAL PRIMARY KEY NOT NULL, "game" text, "race" text, "sex" text, "position" text, "syllable" text, "namepart" text, "created_at" timestamp, "updated_at" timestamp);
CREATE TABLE "statistics" ("id" SERIAL PRIMARY KEY NOT NULL, "game" text, "race" text, "sex" text, "name" text, "created_at" timestamp, "updated_at" timestamp);
CREATE TABLE "users" ("id" SERIAL PRIMARY KEY NOT NULL, "email" text DEFAULT '' NOT NULL, "encrypted_password" text DEFAULT '' NOT NULL, "reset_password_token" text, "reset_password_sent_at" timestamp, "remember_created_at" timestamp, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" timestamp, "last_sign_in_at" timestamp, "current_sign_in_ip" text, "last_sign_in_ip" text, "created_at" timestamp, "updated_at" timestamp);
