INSERT INTO "wows" VALUES(3,'wow','human','Человек','Генератор ников для людей (человек)(РП ники, генератор roleplay ников)','Люди - одна из наиболее молодых рас Азерота. Многие представители человеческой расы посвящают себя служению свету, магии или становятся доблестными воителями. Имена людей как правило просты, но неизменно несут в себе некий смысл. И ничего страшного, что со временем он позабылся или его на самом деле никогда не было.','Кастомный код','2014-04-06 19:33:48.834124','2014-04-29 16:10:23.335407','human');
INSERT INTO "wows" VALUES(4,'wow','orc','Орки','орчище','Орки - пришельцы из мира Драенор, сейчас более известного как Запределье. Несмотря на изначальную приближенность к духам природы, исторически сложилось так, что орки стали известны в качестве кровожадных и неустрашимых воителей. Имя орка звучит грубо, зачастую резко и не отличается гармонией и красотой.','кастом орка','2014-04-07 16:28:43.416587','2014-04-12 14:48:57.803986','orc');
INSERT INTO "wows" VALUES(5,'wow','gnome','Гном','Генератор ников для гномов(РП ники, генератор roleplay ников)','Гномы - искусные механики и инженеры, они обожают мастерить сложные устройства, что нередко приводит к различного масштаба разрушениям. Иногда гномы связывают свою жизнь с магией, что, однако, не мешает звучать их именам так, словно вы потрясли ведро с гайками и болтами.','Кастом','2014-04-07 16:40:19.123333','2014-04-29 16:10:54.646491','gnome');
INSERT INTO "wows" VALUES(6,'wow','dwarf','Дворф','Генератор ников для дварфов(РП ники, генератор roleplay ников)','Дворфы появились в Азероте с момента его сотворения. Изначально их раса называлась Земельниками, но эволюция сделала своё дело, и дворфы, кряжистые и несколько грубые создания, стали такими, какими мы знаем их сейчас. Дворфы являются умелыми мастерами горного, кузнечного и пивоваренного дела, поэтому многие из имен связаны с их ремеслом.','Кастом','2014-04-07 16:40:39.964226','2014-04-29 16:11:33.955851','dwarf');
INSERT INTO "wows" VALUES(7,'wow','nightelf','Ночной эльф','Найтэльф','Ночные эльфы - искусные друиды и священники, отличающиеся наибольшей близостью к природе, среди прочих рас. Звучание имен ночных эльфов приятно на слух - тяга этой расы к жизни и гармонии сделала их красивыми и запоминающимися. У эльфов нет бессмысленных имен - каждый звук имеет своё значение.','Кастом','2014-04-07 16:41:02.427904','2014-04-12 16:16:48.366095','nightelf');
INSERT INTO "wows" VALUES(8,'wow','draenei','Дренеи','Дренейчики','Дренеи - раса космических беженцев, хранящая в своих заветах поклонение свету, веру в пророчества и почитание Наару - своих небесных покровителей. Имена дренеев традиционно содержат много гласных, что делает их непривычными для слуха коренных обитателей Азерота.','кастом','2014-04-07 16:41:38.127834','2014-04-12 16:16:24.654293','draenei');
INSERT INTO "wows" VALUES(9,'wow','worgen','Ворген','Воргеняша','Напрасно Генн Седогрив ожидал, что его великая стена спасет народ Гилнеаса от любой опасности. Горькая судьба постигла жителей славного королевства несмотря на все надежды. Любой ворген - в первую очередь бывший представитель гордого королевства Гилнеас, а значит, ему пристало достойное имя. Имя, которое прославит его обладателя, несмотря на его проступающую волчью натуру.','Кастом','2014-04-07 16:42:04.474798','2014-04-12 16:17:08.573105','worgen');
INSERT INTO "wows" VALUES(10,'wow','pandaren','Пандарен','Медведики','Пандарены - древняя раса медведеподобных существ, которые славятся своей приверженностью к пиву, боевым искусствам и самосовершенствованию. Их имена повторяют традиции Востока - каждый слог имеет собственное значение, а если перевести имя пандарена на один из распространенных в Азероте языков, несложно будет оценить всю его красоту.','Кастом','2014-04-07 16:42:36.901164','2014-04-12 16:17:23.265064','pandaren');
INSERT INTO "wows" VALUES(11,'wow','troll','Тролль','Троллики','Тролли - древняя воинственная раса, отличающася так же и уважением к традициям своего народа. Тролли недалеко продвинулись в технологиях, но чтут заветы своих шаманов, время от времени не забывая раскурить трубочку и поговорить о вуду. Имена троллей звучат порой грубовато, но не лишены некоторого шарма.','кастом','2014-04-07 16:42:54.219726','2014-04-12 16:18:19.173199','troll');
INSERT INTO "wows" VALUES(12,'wow','tauren','Таурен','Бычок','Таурены ничуть не меньше ночных эльфов тяготеют к природе. В основе их традиций лежит поклонение солнцу, природе и уважение предков, давших живущим представителям расы свою бесконечную мудрость. Имена тауренов просты и легко запоминаются. Возможно, именно поэтому они звучат довольно приятно, хотя порой несложно распознать и некую воинственность.','Кастом','2014-04-07 16:43:14.953837','2014-04-12 16:18:36.326500','tauren');
INSERT INTO "wows" VALUES(13,'wow','goblin','Гоблин','Гоблин','То, что гоблины все еще не вымерли, можно объяснить лишь их потрясающей везучестью и свойственной им деловой жилкой. Большинство представителей этой расы оказываются довольно-таки жадными, как до денег, так и до взрывчатки. Если вашего собеседника зовут как-то вроде "Златовзрыв" - постарайтесь не иметь с ним дел. Это может оказаться чревато для вашего кошелька, здоровья или жизни. Или - для всего и сразу.','Кастом','2014-04-07 16:43:48.370989','2014-04-12 16:18:51.957075','goblin');
INSERT INTO "wows" VALUES(14,'wow','bloodelf','Эльф крови','Блады','Эльфы крови - гордая, надменная раса, предками которой являются легендарные высшие эльфы. Они тяготеют к солнцу и магии, именно поэтому их имена нередко несут в себе нечто волшебное, гордое и неустрашимое. Звучание их имен внушает уверенность в их непоколебимости и верности идеалам своего народа.','кастом','2014-04-07 16:44:12.879910','2014-04-12 16:19:08.502075','bloodelf');
INSERT INTO "wows" VALUES(15,'wow','undead','Нежить','Андеды','Отрекшиеся - восставшие люди бывшего Лордаерона. В бытность свою людьми они, разумеется, носили человеческие имена, которые сейчас, возможно, звучат слегка старомодно. Однако, это лишь придает существованию верных служителей королевы баньши некоторую горечь, не дающую позабыть об их прошлом - ведь когда-то все они были людьми.','кастом','2014-04-07 16:44:34.187239','2014-04-12 16:19:24.685320','undead');
INSERT INTO "gw2s" VALUES(1,'gw2','asura','Асура','Асура - Генератор ников для Guild Wars 2','Имена представителей расы Асура очень редко бывают длинными. Они составлены из одного или двух слогов и зачастую имеют повторяющиеся согласные. Это справедливо как в отношении женских, так и мужских имен. Имя Асура - одно слово, они не имеют фамилий. Вторым словом может служить должность, профессия или звание, полученное за какие-либо заслуги. Те же, кто все же берет себе второе имя, считаются другими асура эксцентричными чудаками.','','2014-04-09 11:24:53.958477','2014-04-20 15:30:17.161012','asura');
INSERT INTO "gw2s" VALUES(2,'gw2','sylvari','Сильвари','Сильвари - Генератор ников для Guild Wars 2','Сильвари - нерожденные дети великого древа, и потому не имеют фамилии. Имя Сильвари звучит прямо и честно, а отсутствие второго имени не дает забыть никому из них - и из окружающих - о том, что каждый Сильвари является частью единой семьи, единого мира и всей Тирии.','','2014-04-09 11:25:11.718783','2014-04-20 15:32:24.791313','sylvari');
INSERT INTO "gw2s" VALUES(3,'gw2','norn','Норн','Норн - Генератор ников для Guild Wars 2','Суровый северный народ Норнов издревле брал себе соответствующие характеру и складу души имена. Родители нарекали ребенку имя - а тот должен был прославить его в меру своих способностей. Искусные охотники и любители крепкой выпивки, - а как без неё в холодах? - Норны нередко отличались и на воинском поприще, за что и получали грозные прозвища. Именно эти прозвища со временем и стали их фамилиями.','','2014-04-09 11:25:28.695931','2014-04-20 15:29:15.066037','norn');
INSERT INTO "gw2s" VALUES(4,'gw2','charr','Чарр','Чарр - Генератор ников для Guild Wars 2','Взращенные в пламени и дыму непрекращающихся войн, Чарры, более всего похожие на воинственных рогатых котов, дают своим детям резкие, но вместе с тем и звучные имена. Фамилии - вторые имена - чарров являются так же их прозвищами. Если кот отличается легкой походкой, не оставляющей следов на снегу, вероятнее всего, что товарищи его так и прозовут - Тихоступ.','','2014-04-09 11:25:41.458556','2014-04-20 15:31:54.700112','charr');
INSERT INTO "gw2s" VALUES(5,'gw2','human','Человек','Человек - Генератор ников для для персонажей Guild Wars 2','Имя Человека привычно слуху большинства рас Тирии. Имена бывают короткие и длинные, исполненные значимости и просто имена. В качестве второй части имени люди используют фамилию - она указывает на принадлежность к определенной семье, а, поскольку семья для этой расы имеет немалое значение, то и фамилии носят практически все её представители.','','2014-04-09 11:25:59.914059','2014-04-20 15:28:24.509315','human');
INSERT INTO "samps" VALUES(1,'samp','english','Красивые английские(американские) имена и фамилии','Красивые английские имена - генератор имен и ников для SAMP','Жители туманного Альбиона и всех Соединенных Королевств отличаются прекрасными старинными именами. Красивые английские имена и фамилии являются их достоянием, многие семья ведут свой род со средних веков и по сей день сохраняют красивые фамилии. Британские имена породили так же и американские - фамилии этого народа уже не столь благородны, как у британцев, но тоже хороши. Создайте себе английское или американское (мужское или женское) имя и фамилию для San Andreas Multiplayer. Вы можете создать как мужское, так и женское имя.','','2014-04-09 12:56:09.872333','2014-04-20 15:36:45.885489','english');
INSERT INTO "samps" VALUES(2,'samp','german','Красивые немецкие имена и фамилии','Красивые немецкие имена - генератор имен и ников для SAMP','Немецкие имена известны своей громкостью и некоторой грубостью в звучании. Однако, красивые женские имена и фамилии вовсе не редкость в Германии. Так же, как и мужские, они имеют некоторую жесткость, но эта жесткость так же придает и уникальность звучанию, не говоря уже о собственном очаровании и шарме. Генератор ников позволит создать красивое немецкое имя и фамилию для вашего персонажа в SAMP.','','2014-04-09 12:56:20.123619','2014-04-20 15:37:22.939312','german');
INSERT INTO "samps" VALUES(3,'samp','french','Красивые французские имена - генератор имен и ников для SAMP','Красивые французские имена и фамилии - генератор ников для SAMP','Известно, что французские имена и фамилии - одни из самых красивых в мире. Французы и француженки говорят на легком, воздушном языке, который не допускает грубого произношения. Поэтому красивые французские имена и фамилии свойственны как мужчинам, так и женщинам. На этой странице очень легко создать французское имя для игры в SAMP.','','2014-04-09 12:56:36.187011','2014-04-20 15:39:59.610087','french');
INSERT INTO "samps" VALUES(4,'samp','italian','Красивые итальянские имена и фамилии','Красивые итальянские имена и фамилии - генератор ников для SAMP','Итальянцы - темпераментная и яркая нация. История и традиции этого народа сделала вытачивала имена несколько столетий. Красивые итальянские имена и фамилии - совсем не редкость (как мужские, так и женские), хотя для самих итальянцев это обычное дело. Создайте красивую фамилию для San Andreas Multiplayer и погрузитесь в игру как настоящий итальянец!','','2014-04-09 12:56:44.846424','2014-04-20 15:40:24.934556','italian');
INSERT INTO "samps" VALUES(5,'samp','danish','Красивые датские имена и фамилии','Красивые датские имена и фамилии - генератор ников для SAMP','Дания - родина одного великого сказочника со звучным и громким именем. Датские имена сохраняют в себе традиционное произношение и меняются не так быстро, как имена иных народов. Создайте красивое мужское или женское имя и фамилию для игры в GTA San Andreas Multiplayer и отыгрывайте роль датчанина в мире SAMP.','','2014-04-09 12:56:53.016843','2014-04-20 15:41:02.309108','danish');
INSERT INTO "samps" VALUES(6,'samp','swedish','Красивые шведские имена и фамилии','Красивые шведские имена и фамилии - генератор ников для SAMP','Шведы - северный народ, в их именах слышны отзвуки старинных традиций и морозной зимы. Красивые шведские имена составляют примерно половину от всех имен, присущих жителям Скандинавии. То же самое можно сказать и о красивых шведских фамилиях. Здесь легко сгенерировать красивое мужское или женское шведское имя и фамилию для игры в SAMP.','','2014-04-09 12:57:04.220559','2014-04-20 15:41:40.206707','swedish');
INSERT INTO "samps" VALUES(7,'samp','spanish','Красивые испанские имена и фамилии','Красивые испанские имена и фамилии - генератор ников для SAMP','Страстные испанцы зачастую обладают несколько резкими для непривычного человека именами. Однако, они не лишени своеобразной красоты, и если хоть на секунду задуматься, испанские имена такие же красивые, как и у других народов. Красивые испанские фамилии встречаются не так часто, но и их достаточно много, чтобы сгенерировать мужское (или женское) имя и фамилию для GTA San Andreas Multiplayer.','','2014-04-09 12:57:24.379561','2014-04-20 15:42:12.627339','spanish');
